- apiVersion: v1
  kind: Service
  metadata:
    annotations:
      slb.sfdc.net/cnames: |-
        [
         {
          "cname": "slb-portal-frf.slb.sfdc.net"
         }
        ]
      slb.sfdc.net/name: slb-portal-frf-service
      slb.sfdc.net/portconfigurations: |-
        [
         {
          "httpsredirectport": 443,
          "lbtype": "http",
          "port": 80,
          "targetport": 9112
         },
         {
          "lbtype": "http",
          "port": 443,
          "targetport": 9112,
          "tls": true
         }
        ]
    labels:
      app: slb-portal-frf-service
    name: slb-portal-frf-service
    namespace: sam-system
  spec:
    ports:
    - name: slb-portal-port
      port: 80
      protocol: TCP
      targetPort: 9112
    - name: slb-portal-https-port
      port: 443
      protocol: TCP
      targetPort: 9112
    selector:
      name: slb-portal-frf
    type: NodePort
